Division.create!([
                   { id: 1, date: "2014-02-13", number: 1, house: "senate", name: "Motions &#8212; Statements by the Queensland Premier", source_url: "http://parlinfo.aph.gov.au/parlInfo/search/display/display.w3p;adv=yes;orderBy=_fragment_number,doc_date-rev;page=0;query=Dataset%3Ahansards,hansards80%20Date%3A13%2F2%2F2014;rec=0;resCount=Default", debate_url: "http://parlinfo.aph.gov.au/parlInfo/search/display/display.w3p;adv=yes;orderBy=_fragment_number,doc_date-rev;page=0;query=Dataset%3Ahansards,hansards80%20Date%3A13%2F2%2F2014;rec=0;resCount=Default", motion: "<p class=\"speaker\">Penny Wright</p>\n\n<p>I move:</p>\n\n<p class=\"italic\">That the Senate&#8212;</p>\n\n<p class=\"italic\">(a) notes the Queensland Premier (Mr Newman) has made recent public statements that:</p>\n\n<p class=\"italic\">(i) any lawyer acting for a member of a motorcycling gang is part of what he described as a criminal gang machine, and will say and do anything to defend their clients,</p>\n\n<p class=\"italic\">(ii) members of the legal community, including the judiciary, are living out of touch with society and do not understand what the community wants from the law, and</p>\n\n<p class=\"italic\">(iii) the doctrine of separation of powers between the legislature, the executive and the judiciary is less applicable to Australia than other places;</p>\n\n<p class=\"italic\">(b) affirms that these comments do not acknowledge lawyers' professional obligations, including their duty to the court, the integrity of the judiciary or the application of the separation of powers in Australia's parliamentary democracy, and so are incorrect; and</p>\n\n<p class=\"italic\">(c) calls on the Commonwealth Attorney-General (Senator Brandis) to acknowledge and uphold the integrity of the legal profession and the judiciary across Australia.</p>\n\n <p class=\"speaker\">Alan Ferguson</p>\n\n<p>The question is that the motion moved by Senator Wright be agreed to.</p>\n\n ", clock_time: "012:04:00", debate_gid: "uk.org.publicwhip/senate/2014-02-13.24.2" },
                   { id: 2, date: "2014-02-13", number: 2, house: "senate", name: "Motions &#8212; Coal Seam Gas", source_url: "http://parlinfo.aph.gov.au/parlInfo/search/display/display.w3p;adv=yes;orderBy=_fragment_number,doc_date-rev;page=0;query=Dataset%3Ahansards,hansards80%20Date%3A13%2F2%2F2014;rec=0;resCount=Default", debate_url: "http://parlinfo.aph.gov.au/parlInfo/search/display/display.w3p;adv=yes;orderBy=_fragment_number,doc_date-rev;page=0;query=Dataset%3Ahansards,hansards80%20Date%3A13%2F2%2F2014;rec=0;resCount=Default", motion: "<p class=\"speaker\">Larissa Waters</p>\n\n<p>I, and also on behalf of Senators Wright, Hanson-Young and Ludlam, move:</p>\n\n<p class=\"italic\">That the Senate&#8212;</p>\n\n<p class=\"italic\">(a) notes:</p>\n\n<p class=\"italic\">(i) the concern of communities in South Australia and Western Australia about their land and water being threatened by shale and other unconventional gas mining,</p>\n\n<p class=\"italic\">(ii) that landholders lack the legal right to refuse shale and other unconventional gas mining on their land, and</p>\n\n<p class=\"italic\">(iii) the scientific uncertainty surrounding the environmental and health implications of hydraulic fracturing ('fracking') for shale and other unconventional gas mining; and</p>\n\n<p class=\"italic\">(b) calls on the Federal Government to:</p>\n\n<p class=\"italic\">(i) ban the use of fracking by the unconventional gas industry across Australia, and</p>\n\n<p class=\"italic\">(ii) support the Australian Greens' bill to give landholders the legal right to refuse shale and other unconventional gas mining on their land.</p>\n\n <p class=\"speaker\">Stephen Parry</p>\n\n<p>The question is that the motion moved by Senator Waters be agreed to.</p>\n\n ", clock_time: "012:23:00", debate_gid: "uk.org.publicwhip/senate/2014-02-13.46.2" }
                 ])
